import React from 'react';

export default function About(){
  return (
    <div className="container mx-auto px-4 py-12">
      <h1 className="text-3xl font-extrabold">பற்றி</h1>
      <p className="mt-4 text-gray-700">ஈழிசைஆர்ட்ஸ் கல்லூரி — கர்நாடக இசையின் மரபையும் முதன்மை இலக்குகளையும் கொண்டு பயிற்சி தரும் நிறுவனம். இந்தப் பக்கம் உங்கள் நிறுவனம்/அமைப்பைப் பற்றி விளக்கமாகக் காண்பிக்கும்.</p>
    </div>
  );
}
